        fetchTeamDetails(match.params.id)
    }, [])

    const fetchTeamDetails = (id) => {
        const response = axios.get(`/teams/${id}/`)
        setTeam(response.data)
        console.log(team)
    }

    return (
        <div>
            <div>Team: {team.name} </div>
            <hr></hr>
            <div>Average score: {team.average_score} </div>
            <div>Coach: {team.coach.user.username}</div>
        </div>
    )
}

